export const ordersListActionTypes = Object.freeze({

  ORDERS_STOP_FETCHING: 'orders/stopFetching',
  ORDERS_SET_FETCHING_ERROR: 'orders/setFetchingError',

  ORDERS_FILL: 'orders/fill',

  ORDERS_FETCH_ASYNC: 'orders/fetchAsync',
});
